# --- HOTFIX: PRE-LOAD LIBLLAMA.SO ---
# Buildozer sometimes fails to link this correctly, so we force-load it on startup.
try:
    import ctypes
    print("[ALLMA_BOOT] Attempting to pre-load libllama.so...", flush=True)
    
    # Potential paths where the library might be located
    possible_paths = [
        # Path where we manually pushed it or where recipe installs it
        "/data/data/org.allma.allma_prime/files/app/_python_bundle/site-packages/llama_cpp/libllama.so",
        # Standard Android native library path
        "/data/app/org.allma.allma_prime/lib/arm64/libllama.so",
        # Relative to current directory
        "libllama.so"
    ]
    
    lib_loaded = False
    for lib_path in possible_paths:
        if os.path.exists(lib_path):
            print(f"[ALLMA_BOOT] Found library at: {lib_path}", flush=True)
            os.environ["LLAMA_CPP_LIB"] = lib_path
            try:
                ctypes.CDLL(lib_path)
                print(f"[ALLMA_BOOT] SUCCESS: Loaded {lib_path}", flush=True)
                lib_loaded = True
                break
            except Exception as e:
                print(f"[ALLMA_BOOT] FAILED to load {lib_path}: {e}", flush=True)
        else:
            print(f"[ALLMA_BOOT] Not found at: {lib_path}", flush=True)
            
    if not lib_loaded:
        print("[ALLMA_BOOT] CRITICAL: libllama.so NOT FOUND in any standard path.", flush=True)

except Exception as e:
    print(f"[ALLMA_BOOT] Error in pre-load block: {e}", flush=True)
